import React from "react";
//import { url } from "inspector";
import about from "../images/about.jpg";

class AboutPage extends React.Component {
  render() {
    const style = {
      backgroundImage: "url(" + about + ")",
      backgroundColor: "#E8ECEF",
      borderRadius: 5,
      paddingTop: 25,
      paddingBottom: 25,
      display: "flex",
      justifyContent: "center"
    };
    return (
      <div id="aboutid" style={style}>
        <h2>About Patient Scheduling</h2>
        <p>
          Now register patient appointments to doctors with ease. See timing
          conflicts and save yourself from assigning same time to multiple
          patients.
        </p>
      </div>
    );
  }
}

export default AboutPage;
